import { useState, useEffect } from "react";
// import { Data } from "./emogiJson";
const url = " https://emoji.ymatuhin.workers.dev/";
export const DisplayInput = () => {
  const [textInput, setInput] = useState("");
  console.log(textInput);
  return (
    <div>
      <input onChange={(event) => setInput(event.target.value)} />
      <div>{console.log(textInput)}</div>
    </div>
  );
};
export const Main = () => {
  //   const TextInput = (event) => event.target.value;
  const emogiData = url.map((elem) => <div>{JSON.stringify(elem)}</div>);
  return <div>{emogiData}</div>;
};
